import { Component } from "react";

import defaultImage from './../../../../../wwwroot/images/avatar.png'
import menu from "./../../../../../wwwroot/images/menu_horizontal_dark.png"

import "./Profile.css"

class Profile extends Component{

    props:any =  this.props
    image = defaultImage
    
    openMenu(){
        console.log()
    }

    // componentDidUpdate = (id:number|string, email:string, category:string, image:string) =>
    // {
    //     return 
    // }

    render(){
        let {name} = this.props.userData
        return (
            <div className = "profile">
                <span className="username">Hi, {name}</span>
                <img src={this.image} className="userimage rounded-circle" alt={"name" + name} onClick = {this.openMenu}/>
                <div className="menu-icon"><img src={menu} alt="" /></div>
                <ProfileUserMenu/>
            </div>
        )
    }
}

export default Profile
